import './AboutUs.css'; // reuse same styling

function ThankYou() {
  return (
    <div className="about-page">
      <h1>Thank You for Signing Up!</h1>
      <p>
        Thank you for signing up and registering for our mailing list! Stay tuned for further updates 
        regarding Give&Game and look out for our fully functional website coming August 2025!!!
      </p>
    </div>
  );
}

export default ThankYou;
